import { ChakraProvider, VStack } from "@chakra-ui/react"
import { BrowserRouter } from "react-router-dom"
import { AppRouter } from "./AppRouter"

function App() {
  return (
    <ChakraProvider>
      <BrowserRouter>
        <AppRouter />
      </BrowserRouter>
    </ChakraProvider>
  )
}

export default App
